-- ----------------------------
-- Table structure for arc_approval
-- ----------------------------
DROP TABLE IF EXISTS `arc_approval`;
CREATE TABLE `arc_approval`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '机构id',
  `name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '审批(服务)事项名称',
  `outline` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '纲要',
  `sort` smallint(4) NOT NULL DEFAULT 0 COMMENT '显示序号',
  `category` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类',
  `is_disabled` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否停用',
  `disable_date` date NOT NULL DEFAULT '2999-12-31' COMMENT '停用日期',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_organ_id`(`organ_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_审批服务事项';

-- ----------------------------
-- Table structure for arc_depart_duty
-- ----------------------------
DROP TABLE IF EXISTS `arc_depart_duty`;
CREATE TABLE `arc_depart_duty`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `depart_id` bigint(11) UNSIGNED NOT NULL COMMENT '科室id',
  `duty_id` bigint(11) UNSIGNED NOT NULL COMMENT '岗位职责id',
  `sort` smallint(4) NOT NULL DEFAULT 0 COMMENT '本科室内显示序号',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_depart_duty`(`depart_id`, `duty_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_科室岗位职责';

-- ----------------------------
-- Table structure for arc_department
-- ----------------------------
DROP TABLE IF EXISTS `arc_department`;
CREATE TABLE `arc_department`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `parent_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '父级id',
  `parent_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '全部父级id串',
  `organ_id` bigint(11) UNSIGNED NOT NULL COMMENT '机构id',
  `code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '编号',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '名称',
  `depth` tinyint(4) NOT NULL DEFAULT 1 COMMENT '级次',
  `is_end` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否末级',
  `is_disabled` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否停用',
  `official_depart_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '三定科室id',
  `is_official` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否三定科室',
  `depart_type` tinyint(4) NOT NULL DEFAULT 0 COMMENT '科室类型0常规1主要领导2分管领导3事业单位虚拟科室(枚举字典类 8）',
  `memo` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_organ_code`(`organ_id`, `code`) USING BTREE,
  INDEX `idx_parent_ids`(`parent_ids`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 349 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_科室';

