  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_organ_id`(`organ_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_月报_业务范围清单';

