) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_月报_重点工作';

-- ----------------------------
-- Table structure for arc_mt_yearly_target
