-- ----------------------------
-- Table structure for arc_organ
-- ----------------------------
DROP TABLE IF EXISTS `arc_organ`;
CREATE TABLE `arc_organ`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `parent_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '父级id',
  `parent_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '全部父级id串',
  `code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '编号',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '名称',
  `shorthand` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '简码',
  `depth` tinyint(4) NOT NULL DEFAULT 1 COMMENT '级次',
  `is_end` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否末级',
  `organ_class_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '分类id',
  `report_organ_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '月报主管单位id',
  `organ_type` tinyint(4) NOT NULL DEFAULT 0 COMMENT '机构类型0非实体1机关单位2事业单位(枚举字典9类)',
  `report_type` tinyint(4) NOT NULL DEFAULT 0 COMMENT '填报类型0不填报1日报2月报3日报+月报(枚举字典10类)',
  `entry_date` date NOT NULL DEFAULT '1900-01-01' COMMENT '加入日期',
  `is_competent` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否主管单位',
  `is_revoked` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否撤销',
  `revoke_date` date NOT NULL DEFAULT '2099-12-31' COMMENT '撤销日期',
  `is_emigrate` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否迁出',
  `official_num` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '编制人数',
  `actual_num` smallint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '实际人数',
  `memo` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_code`(`code`) USING BTREE,
  INDEX `idx_class_id`(`organ_class_id`) USING BTREE,
  INDEX `idx_parent_ids`(`parent_ids`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 58 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_机构';

