-- ----------------------------
-- Table structure for arc_user_holiday
-- ----------------------------
DROP TABLE IF EXISTS `arc_user_holiday`;
CREATE TABLE `arc_user_holiday`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '用户id',
  `dictionary_id` smallint(4) UNSIGNED NOT NULL COMMENT '假期类型 ：枚举字典id 7类',
  `reason` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '假期事由',
  `auditor_ids` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '审阅人id串',
  `auto_auditor_ids` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '已确认自动审阅人id串',
  `begin_date` date NOT NULL COMMENT '起始日期',
  `begin_time` tinyint(4) NOT NULL DEFAULT 0 COMMENT '起始时间0上午1下午',
  `end_date` date NOT NULL COMMENT '结束日期',
  `end_time` tinyint(4) NOT NULL DEFAULT 1 COMMENT '结束时间0上午1下午',
  `days` decimal(8, 1) UNSIGNED NOT NULL COMMENT '假期天数',
  `used_count` int(10) NOT NULL DEFAULT 0 COMMENT '已执行次数',
  `last_date` date NOT NULL DEFAULT '1900-01-01' COMMENT '最后执行日期',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_user_id`(`user_id`) USING BTREE,
  INDEX `idx_date`(`end_date`, `begin_date`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_用户休假设置';

-- ----------------------------
-- Table structure for arc_user_supervision
-- ----------------------------
DROP TABLE IF EXISTS `arc_user_supervision`;
CREATE TABLE `arc_user_supervision`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(11) UNSIGNED NOT NULL COMMENT '用户id',
  `supervision_id` bigint(11) UNSIGNED NOT NULL COMMENT '督办事项id',
  `is_ofen` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否常用项',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_user_supervision`(`user_id`, `supervision_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_用户督办事项';

-- ----------------------------
-- Table structure for arc_user_yearly_plan
-- ----------------------------
DROP TABLE IF EXISTS `arc_user_yearly_plan`;
CREATE TABLE `arc_user_yearly_plan`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(11) UNSIGNED NOT NULL COMMENT '用户id',
  `yearly_plan_id` bigint(11) UNSIGNED NOT NULL COMMENT '年度工作计划id',
  `is_ofen` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否常用项',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_user_plan`(`user_id`, `yearly_plan_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_用户年度工作计划';

-- ----------------------------
-- Table structure for arc_work_class
-- ----------------------------
DROP TABLE IF EXISTS `arc_work_class`;
CREATE TABLE `arc_work_class`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `parent_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '父级id',
  `parent_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '全部父级id串',
  `code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '编号',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '名称',
  `depth` tinyint(4) NOT NULL DEFAULT 1 COMMENT '级次',
  `is_end` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否末级',
  `is_profession` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否业务工作类',
  `is_disabled` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否停用',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_code`(`code`) USING BTREE,
  INDEX `idx_parent_ids`(`parent_ids`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 63 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '基础_工作分类';

