-- ----------------------------
-- Table structure for rep_assess_user
-- ----------------------------
DROP TABLE IF EXISTS `rep_assess_user`;
CREATE TABLE `rep_assess_user`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `period` mediumint(9) NOT NULL COMMENT '期间（年月）',
  `organ_id` bigint(10) UNSIGNED NOT NULL COMMENT '机构id',
  `depart_id` bigint(10) UNSIGNED NOT NULL COMMENT '三定科室id',
  `user_id` bigint(10) UNSIGNED NOT NULL COMMENT '用户id',
  `standard_days` tinyint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '标准工作天数',
  `standard_hours` decimal(6, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '标准工作小时数',
  `actual_days` tinyint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '实际填写人次',
  `actual_rows` smallint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '实际填写条数',
  `actual_hours` decimal(6, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '实际填写小时',
  `workday_days` tinyint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '工作日填写人次',
  `workday_rows` smallint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '工作日填写条数',
  `workday_hours` decimal(6, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '工作日填写小时',
  `overtime_days` tinyint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '加班人次',
  `overtime_rows` smallint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '加班条数',
  `overtime_hours` decimal(6, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '加班小时数',
  `travel_days` tinyint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '出差人次',
  `travel_rows` smallint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '出差条数',
  `travel_hours` decimal(6, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '出差小时数',
  `pt_duty` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '岗位职责人次',
  `pt_yearly_plan` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '年度计划人次',
  `pt_supervision` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '督办事项人次',
  `pt_approval` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '审批服务事项人次',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_period_user`(`period`, `organ_id`, `depart_id`, `user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1024 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '统计_评估_个人表';

