-- ----------------------------
-- Table structure for rep_perform_approval
-- ----------------------------
DROP TABLE IF EXISTS `rep_perform_approval`;
CREATE TABLE `rep_perform_approval`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `period` mediumint(9) NOT NULL COMMENT '期间(年月)',
  `organ_id` bigint(10) UNSIGNED NOT NULL COMMENT '机构id',
  `depart_id` bigint(10) UNSIGNED NOT NULL COMMENT '三定科室id',
  `user_id` bigint(10) UNSIGNED NOT NULL COMMENT '用户id',
  `approval_id` bigint(10) UNSIGNED NOT NULL COMMENT '审批服务事项id',
  `work_rows` int(10) UNSIGNED NOT NULL COMMENT '工作日志条数(含加班)',
  `work_hours` decimal(10, 2) UNSIGNED NOT NULL COMMENT '工作日志小时(含加班)',
  `overtime_rows` int(10) UNSIGNED NOT NULL COMMENT '加班日志条数',
  `overtime_hours` decimal(10, 2) UNSIGNED NOT NULL COMMENT '加班日志小时',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_period_approval_id`(`period`, `organ_id`, `depart_id`, `user_id`, `approval_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '统计_履行情况_审批服务事项';

