-- ----------------------------
-- Table structure for rep_review_rate
-- ----------------------------
DROP TABLE IF EXISTS `rep_review_rate`;
CREATE TABLE `rep_review_rate`  (
  `id` bigint(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `period` mediumint(4) NOT NULL COMMENT '期间(年和月)',
  `organ_id` bigint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '机构id',
  `depart_id` bigint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '三定科室id',
  `user_id` bigint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id',
  `target_num` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '应审阅人次',
  `actual_num` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '实际审阅人次',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_period_user`(`period`, `organ_id`, `depart_id`, `user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '报表-审阅率';

-- ----------------------------
-- Table structure for sys_apier
-- ----------------------------
DROP TABLE IF EXISTS `sys_apier`;
CREATE TABLE `sys_apier`  (
  `id` bigint(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '记录id',
  `title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标题',
  `apier` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '接口标识',
  `action` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '命令',
  `is_use_cache` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否缓存',
  `time_out` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '缓存超时时间',
  `is_disabled` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否停用',
  `use_count` bigint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '使用计数',
  `cache_path` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '缓存路径',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `apier_action`(`apier`, `action`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 81 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统_接口管理表';

-- ----------------------------
-- Records of sys_apier
