-- ----------------------------
-- Table structure for sys_attachment
-- ----------------------------
DROP TABLE IF EXISTS `sys_attachment`;
CREATE TABLE `sys_attachment`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `local_file_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '文件名称',
  `host_file_name` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '服务器路径及文件名',
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '附件上传用户id',
  `type` tinyint(4) NOT NULL DEFAULT 0 COMMENT '引用业务类型：0日志1月报2通知',
  `quote_id` bigint(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '引用记录id',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_type_id`(`type`, `quote_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统_附件文档';

-- ----------------------------
-- Table structure for sys_column
-- ----------------------------
DROP TABLE IF EXISTS `sys_column`;
CREATE TABLE `sys_column`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `grid_code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '表格编号',
  `sort` smallint(4) NOT NULL COMMENT '组内唯一序号',
  `caption` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标题',
  `width` smallint(10) UNSIGNED NOT NULL DEFAULT 60 COMMENT '宽度',
  `field_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '字段名称',
  `is_display` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否显示',
  `is_merge` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否合并列',
  `is_fixed` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否固定列',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_gridcode_sort`(`grid_code`, `sort`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统_表格列';

-- ----------------------------
-- Table structure for sys_column_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_column_user`;
CREATE TABLE `sys_column_user`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(10) UNSIGNED NOT NULL COMMENT '用户id',
  `column_id` bigint(10) UNSIGNED NOT NULL COMMENT '表格列id',
  `sort` smallint(6) NOT NULL DEFAULT 0 COMMENT '序号',
  `width` smallint(10) UNSIGNED NOT NULL DEFAULT 60 COMMENT '宽度',
  `is_display` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否显示',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_user_column`(`user_id`, `column_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统_用户表格列';

-- ----------------------------
-- Table structure for sys_data_group
-- ----------------------------
DROP TABLE IF EXISTS `sys_data_group`;
CREATE TABLE `sys_data_group`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '编号',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '数据组名称',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_code`(`code`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统_数据组';

-- ----------------------------
-- Table structure for sys_data_group_organ
-- ----------------------------
DROP TABLE IF EXISTS `sys_data_group_organ`;
CREATE TABLE `sys_data_group_organ`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `data_group_id` bigint(11) UNSIGNED NOT NULL COMMENT '数据组id或用户id',
  `organ_id` bigint(11) UNSIGNED NOT NULL COMMENT '机构id',
  `is_user` tinyint(4) NOT NULL COMMENT '是否用户',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_group_organ`(`data_group_id`, `organ_id`, `is_user`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统_数据组机构';

-- ----------------------------
-- Table structure for sys_data_group_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_data_group_user`;
CREATE TABLE `sys_data_group_user`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(11) UNSIGNED NOT NULL COMMENT '用户id',
  `data_group_id` bigint(11) UNSIGNED NOT NULL COMMENT '数据组id',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_user_data_group`(`user_id`, `data_group_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统_数据组用户';

-- ----------------------------
-- Table structure for sys_dispatch_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_dispatch_log`;
CREATE TABLE `sys_dispatch_log`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '记录id',
  `di_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '调度计划类型(对于枚举字典14类)',
  `di_date` date NOT NULL COMMENT '调度处理日期',
  `begin_time` datetime(0) NOT NULL DEFAULT '1900-01-01 00:00:00' COMMENT '开始时间',
  `end_time` datetime(0) NOT NULL DEFAULT '1900-01-01 00:00:00' COMMENT '结束时间',
  `memo` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `ex_type`(`di_date`, `di_type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 269 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统_调度执行日志';

