-- ----------------------------
-- Table structure for temp_user
-- ----------------------------
DROP TABLE IF EXISTS `temp_user`;
CREATE TABLE `temp_user`  (
  `id` bigint(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'id',
  `official_organ_id` bigint(11) UNSIGNED NOT NULL COMMENT '编制机构id',
  `official_depart_id` bigint(11) UNSIGNED NOT NULL COMMENT '编制科室id',
  `organ_id` bigint(11) UNSIGNED NOT NULL COMMENT '现所在机构id',
  `depart_id` bigint(11) UNSIGNED NOT NULL COMMENT '现所在科室id',
  `code` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '编号登录帐号',
  `name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '姓名',
  `pwd` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `shorthand` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '简码',
  `sort` smallint(4) NOT NULL DEFAULT 0 COMMENT '科室内排序号',
  `role_id` bigint(11) UNSIGNED NOT NULL COMMENT '主角色id',
  `leader_flag` tinyint(4) NOT NULL DEFAULT 0 COMMENT '领导标识0非部门领导1主要领导2分管领导(枚举字典12类)',
  `official_type_id` smallint(4) NOT NULL DEFAULT 0 COMMENT '编制类型：0编外1公务员2机关工人3事业编(枚举字典3类)',
  `transfer_type_id` smallint(4) NOT NULL DEFAULT 0 COMMENT '岗位调动类型id(关联表arc_transfer_type)',
  `transfer_extend_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '借调挂职扩展类型 对应枚举自动16类',
  `entry_date` date NOT NULL COMMENT '入职日期',
  `retire_date` date NOT NULL DEFAULT '2099-12-31' COMMENT '离退日期',
  `is_job` tinyint(4) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否在职',
  `is_assess` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否考核',
  `is_disabled` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否停用',
  `memo` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间'
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci;

