-- ----------------------------
-- Table structure for work_duty_reference
-- ----------------------------
DROP TABLE IF EXISTS `work_duty_reference`;
CREATE TABLE `work_duty_reference`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '用户id',
  `duty_id` bigint(20) UNSIGNED NOT NULL COMMENT '原岗位职责id复制别人日志的岗位职责id',
  `to_duty_id` bigint(20) UNSIGNED NOT NULL COMMENT '目标岗位职责id相对应自己的岗位职责ID',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_user_duty`(`user_id`, `duty_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_日志复制岗位职责对照';

-- ----------------------------
-- Table structure for work_log
-- ----------------------------
DROP TABLE IF EXISTS `work_log`;
CREATE TABLE `work_log`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(11) UNSIGNED NOT NULL COMMENT '用户id',
  `log_date` date NOT NULL COMMENT '日期',
  `state` tinyint(4) NOT NULL COMMENT '日志状态0仅保存,1已上报,2已查阅,3已退回,4已审阅',
  `report_date` datetime(0) NOT NULL DEFAULT '1900-01-01 00:00:00' COMMENT '上报时间',
  `organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '机构id',
  `depart_id` bigint(20) UNSIGNED NOT NULL COMMENT '科室id',
  `official_depart_id` bigint(20) UNSIGNED NOT NULL COMMENT '三定科室id',
  `cost_time` decimal(6, 1) UNSIGNED NOT NULL COMMENT '时长:单位小时',
  `un_audit_ids` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '未审阅人id串',
  `audited_ids` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '已审阅人id串',
  `plan_ids` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '日志计划id串',
  `plan_type` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '1工作计划2休假计划',
  `return_memo` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '退回说明',
  `term_type` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '填报终端类型0电脑端1安卓手机2苹果手机',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_log_user_date`(`user_id`, `log_date`) USING BTREE,
  INDEX `idx_organ_date`(`organ_id`, `log_date`) USING BTREE,
  INDEX `idx_depart_date`(`depart_id`, `log_date`) USING BTREE,
  INDEX `idx_date_organ`(`log_date`, `organ_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_工作日志';

-- ----------------------------
-- Table structure for work_log_list
-- ----------------------------
DROP TABLE IF EXISTS `work_log_list`;
CREATE TABLE `work_log_list`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `work_log_id` bigint(20) UNSIGNED NOT NULL COMMENT '日志主表id',
  `sort` tinyint(4) NOT NULL DEFAULT 0 COMMENT '序号',
  `content` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '日志内容',
  `ampm` tinyint(4) NOT NULL DEFAULT 0 COMMENT '时间1上午2下午3全天4晚上',
  `cost_time` decimal(6, 1) NOT NULL COMMENT '花费时长单位小时',
  `special_auditor_ids` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '审阅人id串',
  `time_type_id` int(11) UNSIGNED NOT NULL DEFAULT 1 COMMENT '时间维度id(sys_enum_item表中的4类记录)',
  `space_type_id` int(11) UNSIGNED NOT NULL DEFAULT 1 COMMENT '空间维度id(sys_enum_item表中的5类记录)',
  `attachment_ids` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '附件文档id串',
  `class_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '工作分类id',
  `duty_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '岗位职责id',
  `plan_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '年度工作计划id',
  `supervision_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '督办事项id',
  `approval_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '审批(服务)事项id',
  `special_work_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '专项工作id',
  `special_item_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '专项项目id',
  `special_measure_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '专项措施id',
  `holiday_type_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '休假类型 对应枚举自动7类',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_work_log_id`(`work_log_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_工作日志明细表';

-- ----------------------------
-- Table structure for work_log_list_queue
-- ----------------------------
DROP TABLE IF EXISTS `work_log_list_queue`;
CREATE TABLE `work_log_list_queue`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `queue_id` bigint(20) UNSIGNED NOT NULL COMMENT '日志队列主表id',
  `cost_time` decimal(6, 1) NOT NULL COMMENT '花费时长单位小时',
  `time_type_id` int(11) UNSIGNED NOT NULL DEFAULT 1 COMMENT '时间维度id',
  `space_type_id` int(11) UNSIGNED NOT NULL DEFAULT 1 COMMENT '空间维度id',
  `class_id` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '工作分类id',
  `duty_id` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '岗位职责id',
  `plan_id` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '年度工作计划id',
  `supervision_id` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '督办事项id',
  `approval_id` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '审批(服务)事项id',
  `special_work_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '专项工作id',
  `special_item_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '专项项目id',
  `special_measure_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '专项措施id',
  `holiday_type_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '休假类型 对应枚举自动7类',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_queue_id`(`queue_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_工作日志子表_队列';

-- ----------------------------
-- Table structure for work_log_plan
-- ----------------------------
DROP TABLE IF EXISTS `work_log_plan`;
CREATE TABLE `work_log_plan`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `begin_date` date NOT NULL COMMENT '开始日期',
  `begin_time` tinyint(4) NOT NULL DEFAULT 0 COMMENT '起始时间0上午1下午',
  `end_date` date NOT NULL COMMENT '结束日期',
  `end_time` tinyint(4) NOT NULL DEFAULT 1 COMMENT '结束时间0上午1下午',
  `is_finish` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否结束',
  `content` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '日志内容',
  `cost_time` decimal(6, 1) NOT NULL COMMENT '时长单位小时',
  `time_type_id` int(11) UNSIGNED NOT NULL DEFAULT 1 COMMENT '时间维度id',
  `space_type_id` int(11) UNSIGNED NOT NULL DEFAULT 1 COMMENT '空间维度id',
  `class_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '工作分类id',
  `duty_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '岗位职责id',
  `plan_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '年度工作计划id',
  `supervision_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '督办事项id',
  `approval_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '审批(服务)事项id',
  `auditor_ids` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '审阅人id串',
  `auto_auditor_ids` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '已确认自动审阅人id串',
  `run_times` int(10) NOT NULL DEFAULT 0 COMMENT '已执行次数',
  `last_run_date` date NOT NULL DEFAULT '1900-01-01' COMMENT '最后执行日期',
  `next_run_date` date NOT NULL DEFAULT '1900-01-01' COMMENT '下次执行日期',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_is_finish`(`user_id`, `is_finish`) USING BTREE,
  INDEX `idx_date`(`end_date`, `begin_date`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_日志计划';

-- ----------------------------
-- Table structure for work_log_queue
-- ----------------------------
DROP TABLE IF EXISTS `work_log_queue`;
CREATE TABLE `work_log_queue`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(11) UNSIGNED NOT NULL COMMENT '用户id',
  `log_date` date NOT NULL COMMENT '日期',
  `organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '机构id',
  `official_depart_id` bigint(20) UNSIGNED NOT NULL COMMENT '三定科室id',
  `cost_time` decimal(6, 1) UNSIGNED NOT NULL COMMENT '时长:单位小时',
  `work_log_id` bigint(11) UNSIGNED NOT NULL COMMENT '工作日志id',
  `is_revoke` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否撤销操作',
  `flag` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '记录处理标示',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_work_log_id`(`work_log_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_工作日志_待处理队列';

-- ----------------------------
-- Table structure for work_log_template
-- ----------------------------
DROP TABLE IF EXISTS `work_log_template`;
CREATE TABLE `work_log_template`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '用户id',
  `depart_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '科室id',
  `is_share` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否科室共享',
  `class_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '工作分类id',
  `content` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '内容',
  `ampm` tinyint(4) NOT NULL DEFAULT 0 COMMENT '时间1上午2下午3全天4晚上',
  `cost_time` decimal(6, 1) UNSIGNED NOT NULL DEFAULT 0.0 COMMENT '花费时长单位小时',
  `sort` smallint(10) NOT NULL DEFAULT 0 COMMENT '序号',
  `duty_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '岗位职责id',
  `plan_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '年度工作计划id',
  `supervision_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '督办事项id',
  `approval_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '审批(服务)事项id',
  `is_auto_import` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否自动引入',
  `import_rule` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '引入方式：d1每天重复；w3代表每周三重复；m16每月16日重复',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_user_id`(`user_id`) USING BTREE,
  INDEX `idx_depart_id`(`depart_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_工作日志模板';

-- ----------------------------
-- Table structure for work_mt_report
-- ----------------------------
DROP TABLE IF EXISTS `work_mt_report`;
CREATE TABLE `work_mt_report`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `year_num` smallint(12) UNSIGNED NOT NULL COMMENT '年度',
  `month_num` tinyint(4) UNSIGNED NOT NULL COMMENT '月份',
  `state` tinyint(4) NOT NULL DEFAULT 1 COMMENT '状态1保存,2上报,3已审阅',
  `score` decimal(6, 2) NOT NULL DEFAULT 0.00 COMMENT '得分',
  `organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '上报机构id',
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '上报用户id',
  `report_date` datetime(0) NOT NULL DEFAULT '1900-01-01 00:00:00' COMMENT '上报时间',
  `attachment_ids` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '附件表id串',
  `audit_organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '审阅单位id',
  `audit_user_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '审阅用户id(审核时填充,非保存上报时填充)',
  `audit_date` datetime(0) NOT NULL DEFAULT '1900-01-01 00:00:00' COMMENT '审阅时间',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `年度`(`year_num`, `organ_id`, `month_num`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_月报';

-- ----------------------------
-- Table structure for work_mt_report_list
-- ----------------------------
DROP TABLE IF EXISTS `work_mt_report_list`;
CREATE TABLE `work_mt_report_list`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `report_id` bigint(20) UNSIGNED NOT NULL COMMENT '主表记录id',
  `dictionary_id` smallint(4) NOT NULL DEFAULT 0 COMMENT '类型:1重点工作2年度目标任务3其他 (枚举字典id 6类)',
  `class_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '重点工作id或年度目标任务id(通过dictionary_id区分)',
  `class_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '分类名称(重点工作或年度目标的纲要)',
  `content` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '月报内容',
  `score` decimal(6, 2) NOT NULL DEFAULT 0.00 COMMENT '得分',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `主表记录id`(`report_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_月报子表';

-- ----------------------------
-- Table structure for work_review
-- ----------------------------
DROP TABLE IF EXISTS `work_review`;
CREATE TABLE `work_review`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `audit_user_id` bigint(20) UNSIGNED NOT NULL COMMENT '审阅人id',
  `log_date` date NOT NULL COMMENT '日志日期',
  `work_log_id` bigint(20) UNSIGNED NOT NULL COMMENT '日志主表id',
  `organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '填报人机构id',
  `depart_id` bigint(20) UNSIGNED NOT NULL COMMENT '填报人科室id',
  `user_id` bigint(11) UNSIGNED NOT NULL COMMENT '填报人用户id',
  `score` tinyint(4) NOT NULL DEFAULT 0 COMMENT '审阅评分',
  `comment` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '审阅评语',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_work_log_id`(`work_log_id`) USING BTREE,
  INDEX `idx_auditor_date`(`audit_user_id`, `organ_id`, `log_date`) USING BTREE,
  INDEX `idx_organ_date`(`organ_id`, `log_date`) USING BTREE,
  INDEX `idx_date_audituser`(`log_date`, `audit_user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_工作日志审阅记录';

-- ----------------------------
-- Table structure for work_review_queue
-- ----------------------------
DROP TABLE IF EXISTS `work_review_queue`;
CREATE TABLE `work_review_queue`  (
  `id` bigint(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `audit_user_id` bigint(20) UNSIGNED NOT NULL COMMENT '审阅人用户id',
  `log_date` date NOT NULL COMMENT '日志日期',
  `work_log_id` bigint(11) UNSIGNED NOT NULL COMMENT '日志主表id',
  `organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '填报人机构id',
  `depart_id` bigint(20) UNSIGNED NOT NULL COMMENT '填报人科室id',
  `user_id` bigint(11) UNSIGNED NOT NULL COMMENT '填报人用户id',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_user_worklog`(`audit_user_id`, `work_log_id`) USING BTREE,
  INDEX `idx_user_date_worklog`(`audit_user_id`, `log_date`, `work_log_id`) USING BTREE,
  INDEX `idx_work_log_id`(`work_log_id`) USING BTREE,
  INDEX `idx_date_audituser`(`log_date`, `audit_user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_工作日志未审阅队列';

-- ----------------------------
-- Table structure for work_transfer_record
-- ----------------------------
DROP TABLE IF EXISTS `work_transfer_record`;
CREATE TABLE `work_transfer_record`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `sent_organ_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '派出机构id',
  `sent_depart_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '派出科室id',
  `sent_official_depart` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '派出三定科室id',
  `user_id` bigint(11) UNSIGNED NOT NULL COMMENT '用户id',
  `receive_organ_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '接收机构id',
  `receive_depart_id` bigint(11) NOT NULL DEFAULT 0 COMMENT '接收科室id',
  `receive_official_depart` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '接收三定科室id',
  `transfer_type_id` bigint(11) NOT NULL COMMENT '借调类型id',
  `transfer_extend_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '借调挂职扩展类型 对应枚举自动16类',
  `receive_user_id` bigint(10) NOT NULL DEFAULT 0 COMMENT '接收人id',
  `is_confirm` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '接收单位是否已经确认',
  `start_date` date NOT NULL DEFAULT '2199-01-01' COMMENT '起始日期',
  `stop_date` date NOT NULL DEFAULT '2199-01-01' COMMENT '结束日期',
  `is_stop` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否已经结束:0否1是',
  `is_assess` tinyint(4) NOT NULL COMMENT '调整后是否考核',
  `memo` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '调整备注',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_need_confirm`(`is_confirm`, `receive_organ_id`) USING BTREE,
  INDEX `idx_r_organ_depart`(`receive_organ_id`, `start_date`) USING BTREE,
  INDEX `idx_s_organ_depart`(`sent_organ_id`, `stop_date`) USING BTREE,
  INDEX `idx_stop`(`is_stop`, `user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_岗位调整记录';

-- ----------------------------
-- Table structure for work_user_holiday_rec
-- ----------------------------
DROP TABLE IF EXISTS `work_user_holiday_rec`;
CREATE TABLE `work_user_holiday_rec`  (
  `id` bigint(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `in_date` date NOT NULL COMMENT '日期',
  `in_time` tinyint(4) NOT NULL DEFAULT 1 COMMENT '时间0上午1下午2全天',
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '用户id',
  `dictionary_id` smallint(4) UNSIGNED NOT NULL COMMENT '假期类型 ：枚举字典id 7类',
  `reason` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '假期事由',
  `organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '机构id',
  `depart_id` bigint(20) UNSIGNED NOT NULL COMMENT '所在科室id',
  `official_depart_id` bigint(20) UNSIGNED NOT NULL COMMENT '三定科室id',
  `user_holiday_id` bigint(20) UNSIGNED NOT NULL COMMENT '休假设置id',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_date_user`(`in_date`, `user_id`) USING BTREE,
  INDEX `idx_date_organ`(`in_date`, `organ_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_用户休假记录';

-- ----------------------------
-- Table structure for work_user_state
-- ----------------------------
DROP TABLE IF EXISTS `work_user_state`;
CREATE TABLE `work_user_state`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `in_date` date NOT NULL COMMENT '日期',
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '用户id',
  `organ_id` bigint(20) UNSIGNED NOT NULL COMMENT '机构id',
  `depart_id` bigint(10) UNSIGNED NOT NULL COMMENT '自定义科室id',
  `official_depart_id` bigint(10) UNSIGNED NOT NULL COMMENT '三定科室id',
  `is_assess` tinyint(4) UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否考核',
  `is_workday` tinyint(4) NOT NULL COMMENT '是否工作日',
  `is_must` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否需要填报',
  `is_report` tinyint(4) NOT NULL COMMENT '是否填报',
  `dictionary_id` smallint(4) NOT NULL DEFAULT 0 COMMENT '不考核说明字典id',
  `transfer_type_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '调岗类型id',
  `holiday_time` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '个人假期时长：0无1半天2一天',
  `gmt_create` datetime(6) NOT NULL DEFAULT current_timestamp(6) COMMENT '创建时间',
  `gmt_modified` datetime(6) NOT NULL DEFAULT '1900-01-01 00:00:00.000000' ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_date_user`(`in_date`, `user_id`) USING BTREE,
  INDEX `idx_user_date`(`user_id`, `in_date`, `id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4093 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '业务_用户工作考核状态表';

-- ----------------------------
-- Records of work_user_state
